import {GoogleLogin} from "react-google-login";

const cliendID = "447618393940-7jd24vhgh4b0hd7n44civpf270k060i8.apps.googleusercontent.com"


function Login (){
  const onSuccess = (res) => {
    console.log("LOGIN SUCCESS! current user: ", res.profileObj);
  }

  const onFailure = (res) => {
    console.log("LOGIN FAILURE! RES: ", res);
  }

  return(
  <div id="signInButton">
    <GoogleLogin
      clientId={cliendID}
      buttonText="Login"
      onSuccess={onSuccess}
      onFailure={onFailure}
      cookiePolicy={'single_host_origin'}
      isSignedIn={true}
   />
  </div>
  )
}

export default Login;
